import React, { useEffect, useState } from 'react';
import { Container, Typography, Table, TableBody, TableCell, TableHead, TableRow, Paper, Button, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, TextField } from '@mui/material';
import { useAuth } from '../../contexts/AuthContext';
import HamburgerMenu from '../../components/HamburgerMenu';
import './PatientList.css';

function PatientList() {
  const [patients, setPatients] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const { user } = useAuth();
  const [open, setOpen] = useState(false);
  const [newPatient, setNewPatient] = useState({
    nominativo: '',
    eta: '',
    altezza: '',
    peso: ''
  });

  const fetchPatients = async () => {
    try {
      const endpoint = user.isAdmin ? '/api/patients' : `/api/patients/assigned?doctor_name=${user.name}`;
      const response = await fetch(`http://localhost:5000${endpoint}`, {
        credentials: 'include', // Include le credenziali
      });
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const data = await response.json();
      setPatients(data);
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchPatients();
  }, [user.isAdmin, user.name]);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
    setNewPatient({ ...newPatient, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/patients', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({ ...newPatient, doctorid: user.uuid }),
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      // Ricarica i pazienti dopo l'aggiunta
      fetchPatients();
      handleClose();
    } catch (error) {
      setError(error.message);
    }
  };

  if (loading) {
    return <div className="root"><Typography>Loading...</Typography></div>;
  }

  if (error) {
    return <div className="root"><Typography>Error: {error}</Typography></div>;
  }

  return (
    <div className="root">
      <HamburgerMenu />
      <div className="content">
        <Container component={Paper}>
          <Typography variant="h4" gutterBottom>
            Lista Pazienti
          </Typography>
          {user && !user.isAdmin && (
            <Button variant="contained" color="primary" onClick={handleClickOpen}>
              Aggiungi Paziente
            </Button>
          )}
          <Table className="styled-table">
            <TableHead>
              <TableRow>
                <TableCell className="table-header">Nominativo</TableCell>
                <TableCell className="table-header">Età</TableCell>
                <TableCell className="table-header">Altezza</TableCell>
                <TableCell className="table-header">Peso</TableCell>
                {user.isAdmin && <TableCell className="table-header">Dottore</TableCell>}
              </TableRow>
            </TableHead>
            <TableBody>
              {patients.map((patient) => (
                <TableRow key={patient.uuid}>
                  <TableCell>{patient.nominativo}</TableCell>
                  <TableCell>{patient.eta}</TableCell>
                  <TableCell>{patient.altezza}</TableCell>
                  <TableCell>{patient.peso}</TableCell>
                  {user.isAdmin && <TableCell>{patient.doctor_name}</TableCell>}
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </Container>
      </div>

      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Aggiungi Paziente</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Compila i seguenti campi per aggiungere un nuovo paziente.
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            name="nominativo"
            label="Nominativo"
            type="text"
            fullWidth
            value={newPatient.nominativo}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="eta"
            label="Età"
            type="number"
            fullWidth
            value={newPatient.eta}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="altezza"
            label="Altezza"
            type="number"
            fullWidth
            value={newPatient.altezza}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="peso"
            label="Peso"
            type="number"
            fullWidth
            value={newPatient.peso}
            onChange={handleChange}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Annulla
          </Button>
          <Button onClick={handleSubmit} color="primary">
            Aggiungi
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}

export default PatientList;
